import React from "react";
import GlobalStyle from "./styles/global";
import Header from "./components/Header";
import Resume from "./components/Resume";

const App = () => {
    return( 
    <>
        <Header />
        <Resume />
        <Form />
        <GlobalStyle />
    </>
)
}

export default App;
